import React from "react";
import "./Product.scss";
import shipping from '../../../assets/images/ic_shipping.png';

function Product() {
  return (
    <div className="product">
      <div className="product__container">
        <img className="product__image" src="https://http2.mlstatic.com/D_NQ_NP_658415-MLA43806893380_102020-V.webp" alt=""/>

        <div className="product__info">
          <div className="product__priceInfo">
            <p className="product__price">$1.990</p>
            <img className="product__shippingImg" src={shipping} alt=""/>
          </div>
          <p className="product__location">Capital Federal</p>

          <div className="product__description">
            <p>Apple Ipod Touch 5g Negro Igual A Nuevo Completo Unico</p>
          </div>
        </div>
      </div>

      <hr />
    </div>
  );
}

export default Product;
